dict.string:
echo '
{"items": [
' > /tmp/_t_xlxs.json

for file in ${PTR_PATH}/Common/xlsx_config/gameConfig/* ${PTR_PATH}/Common/xlsx_config/commonConfig/* ${PTR_PATH}/Common/xlsx_config/designConfig/* ${PTR_PATH}/Common/xlsx_config/gameConfig/enum/*; do
	name=`echo $file | awk -F'/' '{print $NF}'`
    if [[ $name =~ ^[^~].*xlsx$ ]]; then
                echo '{"title":"'$name'","arg":"'$file'"},' >> /tmp/_t_xlxs.json
    fi;
done


echo '
	{"title":"BLANK"}
]}
' >> /tmp/_t_xlxs.json
